- input: "TEXT\x1CC00167213\x1C.TEXT\x1C\x1CF3XA\x1CComment on Late Filing  On December
    10, 2007 the Oklahoma City area was hit with an ice storm.  As a result of the
    storm, large areas of Oklahoma City was without electrical power.  As a result
    of this power outage, the area has been designated as state of emergency area.
    \  During this time this office which prepares and causes to be filed this report
    was without power on two extended occasions. This along with the medical emergency
    of one of the partners of this office was the direct cause of this report being
    filed two days late.  Also, it should be pointed out that the committee elected
    to file this report without completing the reporting of Levin funds.  FEC personnel
    help is required.  Attempts to contact FEC personnel on December 21, were unsuccessful.
    \ An amended report will be filed as soon as FEC reports analysis personnel are
    contacted. THE SECOND AMENDED REPORT IS THE RESULT OF THE 5/1/08 AMENDMENT TO
    THE 5/20/07 REPORT.  ONLY CARRYOVER TOTALS ON THE DETAILED SUMMARY PAGE HAVE CHANGED.
    \ LINES 21(a)(I)&(ii); LINE 32; LINE 36."
